pragma solidity ^0.4.23;


contract Proof {

    mapping(address => bytes32[]) proofs;
    mapping(bytes32 => ProofRecord) hashes;
    mapping(bytes32 => string) tags;

    struct ProofRecord {
        address owner;
        uint8 exists;
    }

    function createProof(bytes32 ipfsHash, string fileTags) public returns(bool) {
        require(hashes[ipfsHash].exists != 1);
        proofs[msg.sender].push(ipfsHash);
        hashes[ipfsHash] = ProofRecord({owner: msg.sender, exists: 1});
        setTag(ipfsHash, fileTags);
    }

    function getProofs() public view returns(bytes32[]) {
        return proofs[msg.sender];
    }

    function setTag(bytes32 ipfsHash, string fileTags) internal returns(bool) {
        tags[ipfsHash] = fileTags;
        return true;
    }

}
